import React from "react";

import { PostPreviewType } from "../../containers/PostsList/types";

import { PostPreviewContainer, Title, Text } from "./styledComponents";

const PostPreview: React.FC<PostPreviewType> = ({ title, body, id }) => (
  <PostPreviewContainer>
    <Title>{title}</Title>
    <Text>{body}</Text>
  </PostPreviewContainer>
);

export default PostPreview;
